import React, { useEffect, useState } from 'react';

const TableData = () => {
    let a = "First Name";

    const [show, setShow] = useState(false);
    const [users, setUser] = useState([{}]);
    useEffect(() => {

        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
                setUser(data);
                setShow(!show);
            })
    }, []);

    return (

        <>
            <table class="table">
                <thead>
                    <tr>
                        <th scope="col">#</th>
                        <th scope="col">First</th>
                        <th scope="col">Last</th>
                        <th scope="col">Handle</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <th scope="row">1</th>
                        <td>Mark</td>
                        <td>Otto</td>
                        <td>@mdo</td>
                    </tr>
                </tbody>
            </table>
            <h1>
                {show && <h1>

                    {
                        Object.keys(users).map((key, i) => (
                            <p key={i}>
                                <span>Key Name: {key}</span>
                                <span>Value: {users[key]}</span>
                            </p>
                        ))
                    }



                </h1>}

            </h1>
        </>
    );
};

export default TableData;
